import React from 'react';
import './Footer.css';
import { Link } from 'react-router-dom';

function Footer() {
  return (
    <div className='footer-container'>
      <section class='social-media'>
        <div class='social-media-wrap'>
          <div class='footer-logo'>
            <Link to='/' className='social-logo'>
             <p> Jacob Metcalfe <i class='fas fa-laptop-code' /></p>
            </Link>
          </div>
          <small class='website-rights'>Made With React | All Photos Taken Myself</small>
          <div class='social-icons'>
            <a target="_blank" rel="noopener noreferrer" href="https://www.linkedin.com/in/jacob-metcalfe-9164b7134/"><i class='fab fa-linkedin' /></a>
            <a target="_blank" rel="noopener noreferrer" href="https://github.com/jacobmetcalfe"><i class='fab fa-github' /></a>
            <a target="_blank" rel="noopener noreferrer" href="https://www.instagram.com/jacob.metcalfe/"><i class='fab fa-instagram' /></a>
            <a target="_blank" rel="noopener noreferrer" href="https://meetflo.zendesk.com/hc/en-us/articles/230425728-Privacy-Policies"><i class='fab fa-twitter' /></a>
          </div>
        </div>
      </section>
    </div>
  );
}

export default Footer;
